import { Movie } from "@mui/icons-material";
import React from "react";
import { Routes, Route } from "react-router-dom";

const Routing = () => {
  return (
    <Routes>
      <Route path="/movies" element={<Movie />} />
    </Routes>
  );
};

export default Routing;
